import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";


const Courses=()=>{
       
        return(   
            <>
            {Sdata.map((val)=>{
   return
       <Card
       imgsrc={val.imgsrc}
       title={val.title}
       />
   })
   }</>
   )
  

    
} ;

export default Courses;
